  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Klamath
  Basin National Wildlife Refuge Complex outlines Refuge accomplishments during the
  1992 calendar year. The Tule Lake National Wildlife Refuge report begins with a
  summary of the year's highlights and weather conditions. Land acquisition is covered.
  The report includes a planning section which discusses management planning, public
  participation, compliance with environmental and cultural resource mandates, and
  research and investigations. Refuge administration is outlined; information about
  personnel, other manpower programs, volunteer programs, funding, safety, and technical
  assistance is given. Habitat management is also covered; subjects include wetlands,
  croplands, grasslands, other habitats, haying, fire management, and pest control.
  The wildlife section of the report discusses wildlife diversity, endangered and
  threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  game mammals, other resident wildlife, animal control, marking and bird banding,
  and disease prevention and control. The public uses of the Refuge described in this
  report include outdoor classrooms, interpretive programs, hunting, wildlife observation,
  other wildlife oriented recreation, picnicking, off-road vehicles, law enforcement,
  and cooperating associations. The equipment and facilities section of the report
  provides information about major maintenance, equipment utilization and replacement
  and computer systems. Cooperative programs and items of interest are provided at
  the end. Refuge brochures and field guides are attached. Narrative reports for Lower
  Klamath, Clear Lake, Upper Klamath, Klamath Marsh, and Bear Valley National Wildlife
  Refuge are included. Refuge brochures are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
